import React from "react";
import ReactDOM from "react-dom/client";
import { ChakraProvider } from "@chakra-ui/react";

const App = () => {
  console.log("App is rendering ✅ with ChakraProvider");
  return <h1 style={{ textAlign: "center" }}>Chakra UI Test ✅</h1>;
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <ChakraProvider>
      <App />
    </ChakraProvider>
  </React.StrictMode>
);
